tables.table_schema:
CREATE TABLE pnl_data (
 pnl_id SERIAL PRIMARY KEY,
 trader_id INT,
 pnl_date DATE,
 total_pnl DECIMAL(10, 2)
);

CREATE TABLE traders (
    trader_id INT PRIMARY KEY,
    trader_name VARCHAR(100),
    account_balance DECIMAL(12, 2)
);

CREATE TABLE trader_accounts (
 trader_id INT PRIMARY KEY,
 trader_name VARCHAR(50),
 account_balance DECIMAL(10,2)
);

CREATE TABLE trade_comments (
 comment_id INT PRIMARY KEY,
 trade_id INT,
 comment_text TEXT
);

CREATE TABLE pnl_data (
    pnl_id INT PRIMARY KEY,
    trader_id INT,
    pnl_date DATE,
    pnl_amount DECIMAL(10,2)
);

CREATE TABLE trader (
    trader_id INT PRIMARY KEY,
    trader_name VARCHAR(100),
    trader_type VARCHAR(50)
);

CREATE TABLE trade_analysis (
    analysis_id INT PRIMARY KEY,
    trader_id INT,
    analysis_date DATE,
    analysis_result TEXT
);

CREATE TABLE performance_metrics (
    metrics_id INT PRIMARY KEY,
    trader_id INT,
    metrics_date DATE,
    metrics_value DECIMAL(10,2)
);
